import React from 'react';
import './ActionButtonCard.css';

const ActionButtonCard = ({ label, color, icon }) => (
  <button className={`action-button-card ${color}`}>{icon && <span className="icon">{icon}</span>} {label}</button>
);

export default ActionButtonCard;
